"use strict";
class Utils {
    /**
    * Checks for is the item object and returns it.
    * @param {T} item The item to check.
    * @returns {boolean} Is the item object or not.
    */
    isObject(item) {
        return !Array.isArray(item)
            && typeof item == 'object'
            && item !== null;
    }
}
module.exports = Utils;
